import "./App.css";
import TopButtons from "./Component/TopButtons";
// import UilReact from "@iconscout/react-unicons/icons/uil-react";
import Input from "./Component/Inputs";
import TimeAndLocation from "./Component/TimeAndLocation";
import TemperatureAndDetails from "./Component/TemperatureAndDetails";
import ForeCast from "./Component/ForeCast";

import getFormatttedWeatherData from './Service/WeatherService'

function App() {


  const fetchWeather=async ()=>{
    const data=await getFormatttedWeatherData({q:"london"})
    console.log(data)
  }

  fetchWeather()


  return (
    <div className="mx-auto max-w-screen-md mt-4 py-5 px-32 bg-gradient-to-br from-cyan-700 to-blue-700  h-fit shadow-xl shadow-gray-400">
      <TopButtons />
      <Input />
      <TimeAndLocation/>
      <TemperatureAndDetails/>
      <ForeCast title="hourly forecast"/>
      <ForeCast title="daily forecast"/>

    </div>
  );
}

export default App;
